INSERT INTO `emailtemplate` VALUES ('1', '[CC TEST] THÔNG BÁO CHI TIẾT HỖ TRỢ LƯƠNG THÁNG #datetime', '<!DOCTYPE html>\r\n<html>\r\n    <head>\r\n        <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\r\n        <title></title>\r\n    </head>\r\n    <body>\r\n        <blockquote class=\"gmail_quote\" style=\"margin:0 0 0 .8ex; padding-left:1ex\"><div dir=\"ltr\"><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;background-image:initial;background-repeat:initial\"><b><span style=\"font-size:14pt;color:rgb(80,0,80)\">THÔNG BÁO CHI TIẾT\r\n        HỖ TRỢ LƯƠNG THÁNG #date</span></b>\r\n        <br/>\r\n        <p class=\"MsoNormal\" style=\"background-image:initial;background-repeat:initial\"><span style=\"font-size:10pt;font-family:Arial,sans-serif\">\r\n        <br/>Vườn Ươm Tinh Vân xin&nbsp;thông&nbsp;báo&nbsp;chi&nbsp;tiết&nbsp;hỗ trợ&nbsp;<b>tháng #date</b>&nbsp;của anh/chị: </span><b><span style=\"font-size:10pt;font-family:Arial,sans-serif\">#name</span></b><span style=\"font-size:10pt;font-family:Arial,sans-serif\"></span></p>\r\n            <table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"716\" style=\"width:537.3pt;border-collapse:collapse;background-image:initial;background-repeat:initial\">\r\n            <br/>\r\n                <tbody><tr style=\"height:22.7pt\">\r\n                    <td width=\"406\" style=\"width:304.3pt;border:1pt solid windowtext;padding:0cm 5.4pt;height:22.7pt;background:rgb(204,255,255)\">\r\n                        <p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"VI\">Diễn giải</span></b><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                    <td width=\"311\" style=\"width:233pt;border-style:solid solid solid none;border-top-color:windowtext;border-right-color:windowtext;border-bottom-color:windowtext;border-top-width:1pt;border-right-width:1pt;border-bottom-width:1pt;padding:0cm 5.4pt;height:22.7pt;background:rgb(204,255,255)\">\r\n                        <p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"VI\">Số tiền</span></b><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                </tr>\r\n                <tr style=\"height:19.85pt\">\r\n                    <td width=\"406\" style=\"width:304.3pt;border-style:none solid solid;border-right-color:windowtext;border-bottom-color:windowtext;border-left-color:windowtext;border-right-width:1pt;border-bottom-width:1pt;border-left-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\">Tổng <span lang=\"VI\">số buổi đi</span> đi<span style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                    <td width=\"311\" valign=\"bottom\" style=\"width:233pt;border-style:none solid solid none;border-bottom-color:windowtext;border-bottom-width:1pt;border-right-color:windowtext;border-right-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\" align=\"right\" style=\"text-align:right\"><span lang=\"VI\">#tong</span><span lang=\"VI\"> buổi</span><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                </tr>\r\n                <tr style=\"height:19.85pt\">\r\n                    <td width=\"406\" style=\"width:304.3pt;border-style:none solid solid;border-right-color:windowtext;border-bottom-color:windowtext;border-left-color:windowtext;border-right-width:1pt;border-bottom-width:1pt;border-left-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\">Tổng số buổi thực tế</p>\r\n                    </td>\r\n                    <td width=\"311\" valign=\"bottom\" style=\"width:233pt;border-style:none solid solid none;border-bottom-color:windowtext;border-bottom-width:1pt;border-right-color:windowtext;border-right-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\" align=\"right\" style=\"text-align:right\">&nbsp;#ngaytt buổi</p>\r\n                    </td>\r\n                </tr>\r\n                <tr style=\"height:19.85pt\">\r\n                    <td width=\"406\" style=\"width:304.3pt;border-style:none solid solid;border-right-color:windowtext;border-bottom-color:windowtext;border-left-color:windowtext;border-right-width:1pt;border-bottom-width:1pt;border-left-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\"><span lang=\"VI\">Hỗ trợ/buổi</span><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                    <td width=\"311\" valign=\"bottom\" style=\"width:233pt;border-style:none solid solid none;border-bottom-color:windowtext;border-bottom-width:1pt;border-right-color:windowtext;border-right-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\" align=\"right\" style=\"text-align:right\"><span lang=\"VI\">#hotro/buổi</span><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                </tr>\r\n                <tr style=\"height:19.85pt\">\r\n                    <td width=\"716\" colspan=\"2\" style=\"width:537.3pt;border-style:none solid solid;border-right-color:windowtext;border-bottom-color:windowtext;border-left-color:windowtext;border-right-width:1pt;border-bottom-width:1pt;border-left-width:1pt;padding:0cm 5.4pt;height:19.85pt;background:rgb(204,255,204)\">\r\n                        <p class=\"MsoNormal\"><b><span lang=\"VI\">Các khoản phụ cấp,\r\n                            thưởng</span></b><span lang=\"VI\" style=\"font-size:12pt\"></span>\r\n                        </p>\r\n                    </td>\r\n                </tr>\r\n                <tr style=\"height:19.85pt\">\r\n                    <td width=\"406\" style=\"width:304.3pt;border-style:none solid solid;border-right-color:windowtext;border-bottom-color:windowtext;border-left-color:windowtext;border-right-width:1pt;border-bottom-width:1pt;border-left-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\"><span lang=\"VI\">Phụ cấp</span><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                    <td width=\"311\" valign=\"bottom\" style=\"width:233pt;border-style:none solid solid none;border-bottom-color:windowtext;border-bottom-width:1pt;border-right-color:windowtext;border-right-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\" align=\"right\" style=\"text-align:right\"><span lang=\"VI\">_</span><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                </tr>\r\n                <tr style=\"height:19.85pt\">\r\n                    <td width=\"406\" style=\"width:304.3pt;border-style:none solid solid;border-right-color:windowtext;border-bottom-color:windowtext;border-left-color:windowtext;border-right-width:1pt;border-bottom-width:1pt;border-left-width:1pt;padding:0cm 5.4pt;height:19.85pt\">\r\n                        <p class=\"MsoNormal\"><span lang=\"VI\">Thưởng</span><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                    <td width=\"311\" valign=\"bottom\" style=\"width:233pt;border-style:none solid solid none;border-bottom-color:windowtext;border-bottom-width:1pt;border-right-color:windowtext;border-right-width:1pt;padding:0cm 5.4pt;height:19.85pt\">#noluc\r\n                    </td>\r\n                </tr>\r\n                <tr style=\"height:19.85pt\">\r\n                    <td width=\"406\" style=\"width:304.3pt;border-style:none solid solid;border-right-color:windowtext;border-bottom-color:windowtext;border-left-color:windowtext;border-right-width:1pt;border-bottom-width:1pt;border-left-width:1pt;padding:0cm 5.4pt;height:19.85pt;background:rgb(204,255,255)\">\r\n                        <p class=\"MsoNormal\"><b><span lang=\"VI\">Tổng lương:</span></b><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                    <td width=\"311\" style=\"width:233pt;border-style:none solid solid none;border-bottom-color:windowtext;border-bottom-width:1pt;border-right-color:windowtext;border-right-width:1pt;padding:0cm 5.4pt;height:19.85pt;background:rgb(204,255,255)\">\r\n                        <p class=\"MsoNormal\" align=\"right\" style=\"text-align:right\"><b><span lang=\"VI\">#luong</span></b><b><span lang=\"VI\"> đồng</span></b><span lang=\"VI\" style=\"font-size:12pt\"></span></p>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n            </table>\r\n            <br/>\r\n            <p class=\"MsoNormal\" style=\"background:white\"><i><span style=\"color:#500050\">Lưu ý: </span></i><i><span lang=\"VI\" style=\"color:#500050\">Mọi thắc mắc về chấm công và phụ cấp xin vui lòng gửi mail cho </span></i><i><span style=\"color:#500050\">Liên DT</span></i><i><span lang=\"VI\" style=\"color:#500050\"> - Phụ trách Hành chính Nhân sự TVi (địa&nbsp;chỉ&nbsp;mail: </span></i><i><span style=\"color:#500050\"><a href=\"mailto:liendt@tinhvan.com\" target=\"_blank\"><span class=\"il\">liendt@tinhvan.com</span></a></span></i><span style=\"color:#500050\">)<i>&nbsp;hoặc liên hệ theo số máy lẻ&nbsp;<b>116</b>&nbsp;để được giải đáp.<u></u><u></u></i></span></p>\r\n        </div>\r\n    </blockquote>\r\n</body>\r\n</html>', '<div style=\"font-size:12.8000001907349px\"><div dir=\"ltr\"><div style=\"font-size:small\">------------------------------<wbr>------------------------------<wbr>------------------------------<wbr>----------------</div><div style=\"font-size:small\">Đặng Thị Liên - Phụ trách nhân sự</div><div style=\"font-size:small\">Trung tâm Vườn ươm Tinh Vân – Tinhvan Incubator (TVi)</div><div style=\"font-size:small\">Email:&nbsp;<a href=\"mailto:liendt@tinh